import React from "react";

const Profile = () => {
  return (
    <div>
      <h3>EMMMANUEL MEFOR</h3>

      <h4>Web Developer</h4>

      <p>
        My name is Emmanuel Mefor, I am currently learning coding at Bethel
        Tech.
      </p>
    </div>
  );
};

export default Profile;
